import React, { Component, } from 'react'

export default (props) => {

    const {persons} = props
    return (
        <div>
            {persons.map((person) => (
                <Fragment>
                    <div>
                        <h1>{person.name}</h1>
                        <h2>{person.phoneNumber}</h2>
                        <h3>{person.email}</h3>
                    </div>
                </Fragment>
            ))}
        </div>
    )
}
